webpackJsonp([32335768289402],{284:function(e,t){e.exports={data:{allPosts:{edges:[{node:{id:"606190",title:"In brief: China VR entertainment firm secures series A funding from Intel Capital",excerpt:"The Beijing-based firm plans to use the money to develop and promote virtual, augmented, and mixed reality content solutions.",featured_image:"https://cdn.techinasia.com/wp-content/uploads/2018/12/Sky-Limit-Entertainment.jpg",date_gmt:"2018-12-20T04:11:10",category:"brief",content:'<blockquote><p><a href="https://www.crunchbase.com/organization/skylimit-entertainment-group#section-overview" target="_blank" rel="noopener">Sky Limit Entertainment</a>, an entertainment technology company committed to creating immersive entertainment and cultural experiences in China, announced the close of a series A funding round from Intel Capital.</p></blockquote>\n<p>Source: Press release</p>\n<p>Sky Limit Entertainmenet will use the undisclosed amount to develop and promote virtual, augmented, and mixed reality content solutions, which can be applied to things like “large-space multiplayer free-roaming interactive games.” It also plans to create more location-based virtual reality content.</p>\n<p>Established in 2015, the Beijing-based company has “over 70 patents to develop technology-driven entertainment.” Its list of existing investors include Lenovo Capital and Incubator Group, Shenzhen Weiyue Creative Investment Group, and Mango Cultural and Creative Industry Private Equity Fund.</p>'}}]}},pathContext:{slug:"sky-limit-entertainment-series-a-intel"}}}});
